func (t *Task) RemoveJob(job string) error {
	v, ok := t.m.Load(job)
	if !ok {
		return fmt.Errorf("Not Found Job %v ", job)
	}
	key := v.(cron.EntryID)
	t.c.Remove(key)
	t.m.Delete(job)
	return nil
}

